import React,{useState} from 'react'
import Header from './Header'

export default function SignIn(props) {
    //hooks
    const [id, setid] = useState(initialState)
    //functions

    return (
        <div>
            <Header header="Sign In"/>
            <input onChange={e=>{setid(e.target.value)}} type="number" />
        </div>
    )
}
